def is_balanced(brackets):
    open_brackets = ['(', '[', '{']
    closed_brackets = [')', ']', '}']
    stack = []
    for bracket in brackets:
        if bracket in open_brackets:
            stack.append(bracket)
        elif bracket in closed_brackets:
            if not stack:
                return False
            if open_brackets.index(stack.pop())!= closed_brackets.index(bracket):
                return False
    if stack:
        return False
    else:
        return True
